import axios from 'axios'

const url = "http://localhost:8080"

const getScores = () => {
    return axios.get(url + "/scores")
}

const saveScore = scoreToBeSaved => {
    console.log(scoreToBeSaved.name + scoreToBeSaved.score)
}

export default {
    getScores:getScores,
    saveScore:saveScore
}
